import React, { useState } from '@mui/material/core';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import { Box } from '@mui/material';

function UserManagement() {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [userOutput, setUserOutput] = useState('');

  const handleCreateUser = () => {
    // Create user logic here (replace with your actual logic)
    setUserOutput(`User Created (Dummy):\nName: ${firstName} ${lastName}\nEmail: ${email}`);
  };

  return (
    <Card>
      <CardContent>
        <Typography variant="h6" gutterBottom>User Management</Typography>
        <Box sx={{ '& > :not(style)': { m: 1, width: '25ch' } }}>
          <TextField label="First Name" variant="outlined" value={firstName} onChange={(e) => setFirstName(e.target.value)} />
          <TextField label="Last Name" variant="outlined" value={lastName} onChange={(e) => setLastName(e.target.value)} />
          <TextField label="Email" variant="outlined" value={email} onChange={(e) => setEmail(e.target.value)} />
          <Button variant="contained" onClick={handleCreateUser}>Create User</Button>
          <Typography variant="body1">{userOutput}</Typography>
        </Box>
      </CardContent>
    </Card>
  );
}

export default UserManagement;
